import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h2> Welcome to the Road</h2>
          <div className="menu">
            <Nav />
          </div>
      </div>
    );
  }
}

class Nav extends Component {
render() {
  const {
    className,
  } = this.props;
  return (
    <div className={className}>
      <h2>navigation</h2>
    </div>
    );
  }
}



export default App;
